import 'package:flutter/material.dart';

void main() => runApp(Task13App());

class Task13App extends StatelessWidget {
  @override
  Widget build(BuildContext context) {
    return MaterialApp(
      debugShowCheckedModeBanner: false,
      home: ImageChanger(),
    );
  }
}

class ImageChanger extends StatefulWidget {
  @override
  _ImageChangerState createState() => _ImageChangerState();
}

class _ImageChangerState extends State<ImageChanger> {
  String imageUrl = 'data:image/jpeg;base64,';

  void changeImage() {
    setState(() {
      imageUrl = imageUrl == 'data:image/jpeg;base64,'
          ? 'data:image/jpeg;base64,'
          : 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcT5rGAYo0IfaL0D8tLXb23tuAMOWC2viTpefQ&s';
    });
  }

  @override
  Widget build(BuildContext context) {
    return Scaffold(
      appBar: AppBar(title: Text('Image Changer')),
      body: Center(
        child: Column(
          mainAxisAlignment: MainAxisAlignment.center,
          children: [
            Image.network(imageUrl),
            ElevatedButton(
              onPressed: changeImage,
              child: Text('Change Image'),
            ),
          ],
        ),
      ),
    );
  }
}